s for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"markdown","id":"3dcb8469","metadata":{"papermill":{"duration":0.027963,"end_time":"2023-12-26T20:40:49.174204","exception":false,"start_time":"2023-12-26T20:40:49.146241","status":"completed"},"tags":[]},"source":["# 8 - Plotting the sentiment scores in the map"]},{"cell_type":"code","execution_count":17,"id":"ecd15ef8","metadata":{"execution":{"iopub.execute_input":"2023-12-26T20:40:49.269006Z","iopub.status.busy":"2023-12-26T20:40:49.231558Z","iopub.status.idle":"2023-12-26T20:40:49.946874Z","shell.execute_reply":"2023-12-26T20:40:49.944848Z"},"papermill":{"duration":0.749902,"end_time":"2023-12-26T20:40:49.951448","exception":false,"start_time":"2023-12-26T20:40:49.201546","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2ATZR8H8N/dZSdtk+5FW0pLJy1QNshQRBBFHCAoLlRcuBXBgYoTQdw40deN\nCgIKbhQRlb1KoYO2dNDS0p00acbdvX8ESu1IV0Lh+H7+ai6XZ6Vpv7l77jlGFEUCAAAAgLMf\n29MNAAAAAAD3QLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA\nAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAA\nkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA