ALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAA\niyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBF/H8ugXfSMkYqNQAAAABJRU5ErkJg\ngg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["McSentimentLocation <- McSentimentLocation[complete.cases(McSentimentLocation$long_round, McSentimentLocation$lat_round), ]\n","\n","# Create a ggplot object for the USA map with location-wise scores\n","usa_basemap <- ggplot() +\n","  borders(\"usa\", colour = \"yellow\", fill = \"yellow\") +  \n","  borders(\"state\", colour = \"grey\", size = 0.2, fill = NA) +  \n","  theme_map()\n","\n","## Plotting the scores\n","McSentimentMap <- usa_basemap + \n","  geom_point(data = McSentimentLocation,\n","             aes(long_round, lat_round, size = score, color = factor(score >= 0)),\n","             alpha = 0.5) +\n","  scale_size_continuous(range = c(1, 10),\n","                        breaks = c(-600, -400, -200, 0, 200, 400, 600),\n","                        labels = c(\"-600\", \"-400\", \"-200\", \"0\", \"200\", \"400\", \"600\"),\n","                        name = \"Sentiment Score\") +\n","  scale_color_manual(values = c(\"red\", \"green\"),\n","                     labels = c(\"Negative\", \"Positive\"),\n","                     name = \"Sentiment\") +\n","  coord_fixed() +\n","  labs(title = \"Sentiment Score in McDonald's Locations of USA\",\n","       size = \"Sentiment Score\")\n","\n","print(McSentimentMap)"]},{"cell_type":"markdown","id":"3417c7a7","metadata":{"papermill":{"duration":0.029669,"end_time":"2023-12-26T20:40:50.011482","exception":false,"start_time":"2023-12-26T20:40:49.981813","status":"completed"},"tags":[]},"source":["# Conclusion\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores.\n","* It is interesting to note that the negative sentiment score reported is way lower than the positive sentiment score reported on the scale."]},{"cell_type":"markdown","id":"b8c310d6","metadata":{"papermill":{"duration":0.029289,"end_time":"2023-12-26T20:40:50.070141","exception":false,"start_time":"2023-12-26T20:40:50.040852","status":"completed"},"tags":[]},"source":["# References\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":23.900825,"end_time":"2023-12-26T20:40:50.66187","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-12-26T20:40:26.761045","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}